import './Moviecard.css'

function Moviescard() {
    return (
        <div>
            <p>{title}</p>
            <p>{year}</p>
            <p>{director}</p>
            <p>{duration}</p>
            <p>{genre}</p>
            <p>{rate}</p>
        </div>
    )
}

export default Moviescard;
